        };
        return items;
    }

    public List<Booking> BookingsByUser(string id)
    {
        List<Booking> items = new();
        foreach (var booking in bookings)
        {
            if (booking.bruger_id == userId)
            {
                items.Add(booking);
            }
        }
        return items;

    }


